import React from 'react';
import { useNavigate } from 'react-router-dom'; // Import useNavigate
import './Portfolios.css'; // Import custom CSS

const Portfolioslist = () => {
  const navigate = useNavigate(); // Initialize useNavigate

  const handleBackClick = () => {
    navigate('/portfolioslist'); // Navigate to /portfolioslist when Back button is clicked
  };
  
  const handleCardClick = () => {
    navigate('/productdetail'); // Navigate to /productdetail on card click
  };
  const handleSavePdfClick = () => {
    // URL or path to the PDF file
    const pdfUrl = '/Product Catalog - Bluish Stone Effect.pdf';
  
    // Trigger the PDF download
    window.open(pdfUrl, '_blank');
  };

  return (
    <div className="main_menu_wrapper container-fluid">
              <div className='backbtn'>
                <div>
                <button onClick={handleBackClick} style={{ border: 'none'}}>
                    Back
                </button>
                </div>
                <div>
                <button className="pdf_btn" onClick={handleSavePdfClick}>
            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">
                <path d="M19 3H5c-1.1 0-2 .9-2 2v14c0 1.1.9 2 2 2h14c1.1 0 2-.9 2-2V5c0-1.1-.9-2-2-2zm0 16H5V5h14v14zm-8-4h2v-2h-2v2zm0-4h2V7h-2v2zm-4 6h10v-1.5H7V15z"/>
            </svg> Save PDF
            </button>
      </div>
       
    
      <div className="portfoiliolist container mt-4">
        <div className="row">
          <div className="col-12 mb-4" onClick={handleCardClick}> {/* Add onClick to the card */}
            <div className="card bg-dark text-white">
              <img src="/img1.png" className="card-img" alt="Antique Walnut" />
              <div className="card-img-overlay d-flex justify-content-between align-items-center">
                <h5 className="card-title">ANTIQUE WALNUT</h5>
              </div>
            </div>
          </div>
          <div className="col-12 mb-4" onClick={handleCardClick}> {/* Add onClick to the card */}
            <div className="card bg-dark text-white">
              <img src="/img2.png" className="card-img" alt="Bluish Moon Rock" />
              <div className="card-img-overlay d-flex justify-content-between align-items-center">
                <h5 className="card-title">BLUISH MOON ROCK</h5>
              </div>
            </div>
          </div>
          <div className="col-12 mb-4" onClick={handleCardClick}> {/* Add onClick to the card */}
            <div className="card bg-dark text-white">
              <img src="/img3.png" className="card-img" alt="Marble Effect Black" />
              <div className="card-img-overlay d-flex justify-content-between align-items-center">
                <h5 className="card-title">MARBLE EFFECT BLACK</h5>
              </div>
            </div>
          </div>
        </div>
      </div>
      </div>
      </div>
  );
};

export default Portfolioslist;
